pragma solidity ^0.4.17;


contract BiddingTicTacToe {

    // Play at:
    //
    //   * Web: https://BiddingTicTacToe.com
    //
    //   * Telegram: https://t.me/BiddingTicTacToeBot

    address public owner; // Creator of the contract
    address public fees; // 1% fee is accumulated here on top-ups
//    address public server; // Controls & changes balances

    //        uint txPrice = tx.gasprice * gasCostToWithdraw;

    enum Player {None, X, O}

    struct Game {
    address PlayerX;
    address PlayerO;
    uint bank;
    Player winner;
    }

    mapping (uint => Game) games;

    uint constant gasCostToStartGame = 1000;

    uint constant gasCostToJoinGame = 1000;

    uint constant gasCostToBid = 1000;

    uint constant gasCostToWithdraw = 22000;

    mapping (address => uint) balances;


    function topUp() public payable returns (uint balance){
        require(msg.value > 100);
        uint fee = msg.value / 100;
        balance = balances[msg.sender] + msg.value - fee;
        balances[msg.sender] = balance;
        fees.transfer(fee);
    }

    function withdraw(uint value) public {
        var balance = balances[msg.sender];
        require(balance > 0 && value <= balance);
        if (value == 0) {
            value = balance;
        }
        balances[msg.sender] = balance - value;
        msg.sender.transfer(value);
    }

    function userBalance(address user) public constant returns (uint balance) {
        return balances[user];
    }

    struct Stranger {
    address user;
    uint minGameBid;
    uint maxGameBid;
    }

    Stranger[] strangers;

    uint lastGameID;

    function playWithStranger(uint minGameBid, uint maxGameBid) public payable returns (uint gameID, uint currentMin, uint currentMax, string gameStatus) {
        require(minGameBid > 0 && maxGameBid >= minGameBid);
        require(msg.value > 100 || balances[msg.sender] > 0);
        if (msg.value > 0) {
            topUp();
        }
        currentMin = 1 << 255;
        int selfIndex = - 1;
        Stranger memory stranger;
        for (uint i = strangers.length - 1; i >= 0; i--) {
            stranger = strangers[i];
            if (stranger.user == msg.sender) {
                selfIndex = int(i);
            }
            if (stranger.minGameBid < currentMin) {
                currentMin = stranger.minGameBid;
            }
            if (stranger.maxGameBid > currentMax) {
                currentMax = stranger.maxGameBid;
            }
            if (// match
            stranger.minGameBid <= maxGameBid && stranger.maxGameBid >= minGameBid) {
                gameID = lastGameID + 1;
                lastGameID = gameID;
                stranger.user = 0;
                stranger.minGameBid = 0;
                stranger.maxGameBid = 0;
                strangers[i] = stranger;
            }
        }
        if (selfIndex == - 1) {
            gameID = lastGameID + 1;
            lastGameID = gameID;
            strangers[strangers.length] = Stranger({user : msg.sender, minGameBid : minGameBid, maxGameBid : maxGameBid});
            gameStatus = "Awaiting for a stranger to join. Share this game to get opponent faster: https://biddingtictactoe.com/etherium-game?id=YOUR_GAME_ID_HERE";
        }
        else {
            i = uint(selfIndex);
            stranger = strangers[i];
            if (stranger.minGameBid != minGameBid || stranger.maxGameBid != maxGameBid) {
                stranger.minGameBid = minGameBid;
                stranger.maxGameBid = maxGameBid;
                strangers[i] = stranger;
            }
        }
    }

